import Entry from "./entry";
/**
 * List of projects on the home page. 
 * Takes in an array of ProjectProps 
 * Displays each of them as an entry 
 * 
 * returns the list of projects the user currently has
 */

/*
 * Props to Projects component 
 * contains the name of the project
 * and the date last modified  
 */
export interface ProjectProp {
    name: string,
    dateLastModified: string,
}

const Projects = (projects: ProjectProp[]) => {

    /**
     * map over the lists
     * turn each into an entry 
     *      this will return an array of entry components 
     * and then i can render the array of entries
     * by putting them in a div that forces them to stack or something 
     * 
     * (the div also needs to make it stretch the width)
     */

    return(
        <> this is the project list !</>
    );
}

